.header-container {
  display: flex;
  height: 580px;

  box-sizing: border-box;

  font-family: Open Sans;
  padding: 0;

  @media screen and (min-width: $mobile) {
    width: 480px;
  }
  @media screen and (min-width: $tablet) {
    width: 768px;
    height: 680px;
  }
  @media screen and (min-width: $desktop) {
    width: 1280px;
  }
}

.social-wraper {
  width: 160px;

  display: flex;
  flex-direction: column;
  align-items: center;
  // justify-content: space-between;

  @media screen and(max-width: 767px) {
    position: absolute;
    margin: 0 auto;
  }

  @media screen and(min-width: $desktop) {
    width: 155px;
  }
}

.social-list {
  position: relative;
  display: flex;
  flex-direction: row-reverse;
  transform: rotate(-90deg);
  @include font(600, 11px, 1.33);
  letter-spacing: 0.2em;
  color: $title-main-color;
  margin-top: 375px;

  & a {
    color: currentColor;
  }

  &::before {
    content: '';

    position: absolute;
    top: 6px;
    left: -60px;
    height: 1px;
    width: 60px;
    background-color: $title-main-color;
  }

  @media screen and(max-width: 767px) {
    display: none;
  }
}

.social-item {
  margin-left: 40px;

  &:hover,
  &:focus {
    color: $acent-color;
  }
}

.logo {
  margin-top: 25px;

  @media screen and(max-width: 767px) {
    position: absolute;
    left: 30px;
    z-index: 1;
    top: 15px;
  }

  &-icon {
    fill: $title-secondary-color;
    width: 69px;
    height: 55px;

    @media screen and(min-width: $tablet) {
      fill: $title-main-color;
    }
  }
}

.header-wraper {
  position: relative;
  width: 100%;
  background-image: url(../images/head3_480m.jpg);

  @media screen and(min-width: $tablet) {
    width: 85%;
    background-image: url(../images/head3_609t.jpg);
  }

  @media screen and(min-width: $desktop) {
    background-image: url(../images/head3_1125.jpg);
  }
  background-repeat: no-repeat;
}

.menu-button {
  position: absolute;
  display: inline-flex;
  top: 0;
  right: 0;
  z-index: 100;

  padding: 10px;
  border: none;
  outline: none;

  margin-top: 50px;
  margin-right: 30px;
  margin-left: auto;

  width: 40px;
  height: 40px;

  background-color: transparent;
  fill: #fff;

  svg {
    width: 100%;
    height: 100%;
  }

  & .icon-cross {
    display: none;
  }

  &.is-open .icon-cross {
    display: block;
    fill: $title-main-color;
  }
  &.is-open .icon-menu {
    display: none;
  }

  @media screen and (min-width: 768px) {
    display: none;
  }
}

.site-nav-auth {
  color: white;

  & a {
    color: currentColor;

    &:hover {
      color: $acent-color;
    }
  }

  @media screen and(max-width: 767px) {
    position: fixed;
    top: 0;
    height: 100%;
    width: 337px;
    z-index: 10;
    background-color: #fff;

    @include font(600, 18px, 1.33);
    letter-spacing: 0.1em;
    color: $title-main-color;

    right: -100%;
    transition: right 0.2s;
  }

  @media screen and(min-width: $tablet) {
    display: flex;

    @include font(600, 12px, 1.33);
    letter-spacing: 0.1em;
  }

  &.is-open {
    right: 0;

    box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.04), 0px 2px 4px rgba(0, 0, 0, 0.08),
      0px 1px 3px rgba(0, 0, 0, 0.16);
  }
}

.site-nav-list {
  @media screen and(min-width: $tablet) {
    display: flex;
  }
}

.site-nav-item {
  margin-top: 24px;
  margin-left: 40px;

  &:first-child {
    margin-top: 118px;

    @media screen and(min-width: $tablet) {
      margin-top: 52px;
    }
  }

  @media screen and(min-width: $tablet) {
    margin-left: 24px;
    margin-top: 52px;
  }

  @media screen and(min-width: $desktop) {
    margin-left: 40px;
  }
}

.auth-nav {
  @media screen and(min-width: $tablet) {
    display: flex;
    flex-direction: column-reverse;
    align-items: center;
  }

  @media screen and(min-width: $desktop) {
    flex-direction: row;
    align-items: baseline;
    margin-left: auto;
  }
