    @include font(normal, 18px, 1.33);
  }

  margin-top: 20px;
}

.social-list-menu {
  position: relative;
  margin-top: 64px;
  letter-spacing: 0.2em;

  &::before {
    content: '';

    position: absolute;
    top: 10px;
    left: 40px;
    height: 1px;
    width: 60px;
    background-color: $title-main-color;
  }

  @media screen and(min-width: $tablet) {
    display: none;
  }
}

.social-item-menu {
  margin-left: 140px;

  &:not(:first-child) {
    margin-top: 24px;
  }

  &:hover,
  &:focus {
    color: $acent-color;
  }
}

.overlay {
  overflow: hidden;
  height: 100%;
  position: relative;

  &::after {
    content: '';

    position: fixed;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    background-color: rgba(0, 0, 0, 0.2);
    z-index: 9;
    pointer-events: none;
  }
